The pink Lotus Bloomed for the first time in September 2014, under the aegis of Chairperson Ms Divya Oswal, alongwith the concerted and creative efforts of Ms. Monica Chowdary and Ms. Sangeeta Jain.

And the Pink Lotus blooms yet again through this spectacular fashion show, beautifully curated by the very promising FLO chairperson Ms. Ankita Gupta and her hardworking team, to celebrate the spirit of breast cancer Survivors.

Let us now Unveil the blossoming of this pink lotus through the words of Ms. Divya Oswal and Ms. Sangeeta Jain.

